Muchi Maler obed Japuonjwa
Kwasomo Wachni.

verse3:
Weche mwawinjo e Skundwa ka;
Mi mondo gimoki e chunywa;
Mondo wawuoth kuomgi e nyim ji;
Kwaluwo ndachi.

verse2:
To tichwa mar tinende koro oserumo;
Kendo waduogo paki, kendo wakwayoi,
Iritwa duto ka man'on ka wanindo gotienoni.

verse1:
Bedi koda, piny koro yusona;
Polo to chido, Yesu bed koda;
Ka onge moro madhi konyoa,
Jakony jochan Iwuon, bedi koda.

verse2:
Chien'ndalona to koro rumona;
Gik managombo tinde kadhona;
Duto maneno lokore to tho,
In mak ilokori, bedi koda.

verse5:
Chien'tho inyisa kaka In nitho;
Ka piny ochido polo e'orieny;
Chien'cha noru, to mudho duto orum,
Kangima, ka'atho, bedi koda.

verse4:
Tin'ru chunyu koro, dende ka Ruoth,
Kukelo taith duto e od keno;
Chunywa mor moloyo, wanawer wende;
Waseyudo gweth mowacho.

verse1:
Ringra namiyoi, remba nochwer ni in;
Nawaroi adier e teko mar Satan;
Yandi remba nochwer ni in, an' mimiyo an?
Yandi remba nochwer ni in, an' mimiyo an?

verse2:
Naweyo od Wuora, gi duon'ma nie polo;
Nachandora e piny, mondo anyisi yo;
Yandi achandora ni in, an' mitiyona?
Yandi achandora ni in, an' mitiyona?

verse3:
Bura noloyoi, to an nayudo chwat;
Natho e Kalwari, mondo akony jopiny;
Yandi atho mon'awari; an' mitimona?
Yandi atho mon'awari; an' mitimona?

verse1:
Nitie Wendo e dhoot, dak yawne; (Dak yawne Jawa);
Osebedo kanyo chon, dak yawne; Yawne ka pok okadho;
Ruakeuru, Ruoth Maler, Yesu Kristo Wuod Nyasaye, dak yawne.

Nawinjo Yesu kowacho, "Bii Ira mon'iyue;
In n' mojony, bi mon'iyue, Iyud yueyo kuoma."
Nabirone kaka nabet, Najony, naol chutho;
Yesu nomiyoa yueyo, Omiyo chunya mor.

verse2:
Nawinjo Yesu kowacho, "Namii pi ngima;
Ka riyo maki, bi ira, modhi, iyud ngima."
Nabirone mit namodho, pigno momiyoa;
Riyo norumo, to koro angima kuom Ruodha.

Yesu Jakwath madieri, Nochiwo ngimane; 
Oluongo jo moruenyo, Mondo gibi ire. 
Returu a e kethruok, Yesu owachonu; 
Donju'ekul mar Yesu, To En Jakwath maber.

Mit ki kalo nam, dotami, Ka'idwaro puonjo mwa; 
To inyalo puonjo jou, Mabedo e mudho ka; 
Lu ni ji duto moketho,Yesu nosethonigi;  
Bende wachi ni nyithindo,Yesu e moherogi.

verse1:
Wasewinjo wach maber, Yesu ni Jawarwa; 
To keuru wechegi, Yesu ni Jawarwa;
Landuru e pinje te, puonjuru ji wach maber, 
Ruodhwa e mochikowa, Yesu ni Jawarwa.

N' mowinjo dwond Ruoth, one'oyie; 
Oland wachne mondo ji duto winje; 
Wachne mon'odhiyo e pinje duto; 
N' mowinjo dwonde, bi.

verse3:
N' madwaro chutho, osesingone, 
N' mobiro piyo ok nodog nono; 
N' madwaro chutho, noyudi ngima; 
N' moyie mondo, obi.

verse2:
Yesu okadho, Yesu okadho, Biuru, ran'nde, ni Jathieth ji;
Rembe nochwernu, ni mon'owaru, 
To enowinju kuluonge koro;
Yesu okadho, odwaro konyu.

verse3:
Yesu okadho, Yesu okadho, Un jo moketho, biuru ire; 
Tinde wasayu; yieuru koro; 
Biuru piyo ka pod oluongu; 
Un jo moketho, yieuru Yesu.

verse1:
"Un jo mojony, biuru, Namiu yueyo, An;"
Winjuru dwond Ruoth Yesu, owuoyonwa koro;
Onyisowa n'onone, kaka nowenwa keth;
Gi mor mar chuny mosiko, gi hera mochwere.

verse3:
Un jo mool, motho, to Yesu oluongou;
Odwaro miu ngima, nokonyu e lwenju;
Jasigu tek ahinya, Lweny kedore mager;
To waseyudo teko mar loyo jasikwa.

verse1:
Nitie remo ma nosechwer, Ne en remb Immanuel; 
Jo maricho koluokoree, Gipwodhore maler. 
Gipwodhore maler, Gipwodhore maler; 
Jo maricho koluokore, Gipwodhore maler.

verse2:
Jamecho cha e kar thone Noyudo mor kuome; 
To an bende ma ok aler, Noluokna kethna te. 
Noluokna kethna te, Noluokna kethna te; 
To an bende ma ok aler, Noluokna kethna te.

verse1:
Ruoth Yesu, agombo bedo n'ti chuth; 
In mon'idag e chunya pile pile; 
Gol kuoma maricho gi tim ma ok ler; 
Luoka gi rembi mon'abedi mapoth.

verse2:
Ruoth Yesu, para gi e polo malo; 
Ikonya ni mon'achiwrani chutho, 
Misango mangima, maler, malon'; 
Luoka gi rembi mon'abedi mapoth.

verse3:
Ruoth Yesu, akwayoi gi chuny mamuol, 
Arito koro ni mondo igwedha; 
Rembi mon'oguda kuom duto mak ler; 
Luoka gi rembi mon'abedi mapoth.

verse4:
Ruoth Yesu, alin'nyimi ka ageno,
Ni mondo ichwena chuny manyien chutho; 
To jogo makwayi ok iniriembgi; 
Luoka gi rembi mon'abed mapoth.

verse1:
Yesu Luongi, we tin'i mar richo; 
Nitie teko e remb Nyarombo;
Mondo ilo gik maricho duto,
Kuom teko mar remb Nyarombo.

verse2:
Yie we paro kod sunga mar chunyi; 
Nitie teko e remb Nyarombo;
Bi bed maler kuom remb yadh Kalwari, 
Kuom teko mar remb Nyarombo.

verse1:
Geno Kristo kelonwa mor, Kwawuotho e piny ka; 
Ohoyo chunywa kwawuotho, E pinyni mar chandruok; 
Ohoyo chunywa kwawutho, E pinyni mar chandruok

verse2:
Onyisowa piny mar yueyo, Kar dak mar jo maler; 
Wanarom gi jomwahero, Pogruok onge kendo; 
Wanarom gi jomwahero, pogruok onge kendo.

verse3:
E piny ma keth ok nyal donjo, Ok wanayud temruok;
To wanabed gi mor maber, Ma ok nyal kethre ngan'
To wanabed gi mor maber, Ma ok nyal kethre ngan'

verse4:
Pi wan'onge ka maberno, Tho ok nodonj kanyo;
Duto modak kanyo, nochal Gi jomalaika;
Duto modak kanyo, nochal Gi jomalaika.

verse5:
Ndalo mondo runwa piyo; Jawarwa Yesu, bi!
Wagombo neni ka'ibet, Wadag kodi kucha;
Wagombo neni ka'ibet, Wadag kodi kucha.

verse1:
Nyasaye ni lerna, koro ok aluor!
E mudho , e chien' to En koda pile;
Owara e kethruok, ohoyo chunya;
Amor gi Yesu moherowa kama.

verse3:
Nyasaye ni lerna, kendo tekona;
An'yo e tekono anyalo lo;
Oumo yomna gi duon'mare;
Kawuotho gi Yesu koro ok aluor.

verse4:
Nyasaye ni lerna, adware kende;
Mudho onge chutho ka an kod Yesu;
Koro En Jawarna, bende Jakonywa,
Gi Malaika anapake pile.

verse1:
Koro wagenoi, Yesu mar Kalwari, Yesu Ruodhwa;
Winjwa kwalamoi, Gol kethruokwa oko,
Konywa bedo maber pile pile.

verse2:
Ruoth, nyiswa n'ononi, Jiw chunywa, itegwa, Mednwa geno;
Kaka nisethonwa, Miwa heri chutho
Gi hera mosiko, Mak lokore.

verse1:
An'yo Wuonwa on'yo, yembe madigen'wan'yora;
To onyalo riembo mudho, komiya ler marieny chutho,
Komiya ler marieny chutho.

verse3:
An'yo Wuonwa on'yo, ayom ok anyal wasika;
Kendo nojuka kuom tichna, kendo norita nyaka chien'
Kendo norita nyaka chien'

verse4:
An'yo Wuonwa on'yo, saa ma wuodha norum e piny;
To mad saano yaye Ruodha, yuda kapadora kuomi
Yuda kapadora kuomi.

verse1:
Ka'abed jaketh maduon' Remb Yesu nochwer ni an;
Nothona ni kik atho, To adag kode polo;
Asiki but Jawarna, An n'te, to En Ruodha.

verse3:
Ka'abed jaketh maduon' Kristo osen'onona;
Dwarona kod kuyona, Mago duto on'yo;
Okonya e lwenje chuny, Ngimana okan kuome.

verse1:
Kata ka abedo gi ngima maber, kata ka ayudo chandruok;
Kata abet nade, imiya n'yo, Kuomi to anyalo
To anyalo bet gi kuwe.

verse2:
Kata Satan sanda, kayudo temruok;
Wach mojiwo chunya e ma; Kristo osen'yo yomna duto te,
Ne otho ni mon'ores chunya.

verse3:
Amor koro nikech richona duto ogur, e msalaba mare;
Notin' kwet duto, oresa chutho;
Adendo nying Yesu ma Jawar.

verse1:
Kwawuotho gi Ruodhwa, kuom ler manie wachne,
Morienyna e yorwa pile ka;
Ka watimo tichne, Enobedi kodwa, bende gi ji duto.

Yesu Kristo En Osiepwa, En mogolo richowa;
Wan wanyalo kwaye pile gi maber mwachando ka;
To nikech wahero saye, ok walame pile ka,
Kuwe oonge e i chunywa, eka wan wachandore.

verse3:
Wan wanyap, wajony to pile, richowa ohingowa;
Lwandawa en Yesu Kristo, ber kwanyiso Yesu wach;
Ka osiepewa ke kodwa, ber kwanyiso Yesu wach;
Enoruakwa, enokonywa, enomiwa chuny mamor.

verse1:
Ruoth, ok akwayoi tinde weche mag kiny;
Rita kuom richo duto te tinendeni;
Dhoga kik opus wach moro Ma ok lon';
In mon'ibed Jarit dhoga tinendeni.

verse2:
Adwaro tiyoni matek kachiel galam;
Konya abed man'on e wach, gi tim bende;
Miya teko mar winjoi, atim chikno;
Konya kik atim dwarona tinendeni.

verse3:
To kata ngimana dirum kwauononi;
Mondo yuda kapadora kuom singruokni;
Mit kata ok akwayoi weche mag kiny,
Rita, taya, imaka, Ruoth, tinendeni.

verse1:
Ruoth En E Jakwadha, orita maber;
Lum man'ch omiya, oruaka e kunde;
Oteloni chunya kar pige mokuwe;
Oduoga kabayo, ohoyo chuny man'ch.

verse2:
Kayudo masira kata tho malich,
Nikech In mirita,Ok naluor gimoro;
Igen' gi ludhi kod odungani;
Gima rach ok nyala ka Jakony ni buta.

verse3:
Ipedhona mesa ndalo mar chandruok;
Imiya gweth man'ny ma onge kar giko;
Iolona mo man'e n'r e wiya;
N'ononi mogundho omako dhoga chuth.

verse4:
N'ononi gi berni, Nyasacha maber;
Mondo luwre koda nya'achop iri ku;
Nalu yorno ma jo machon noluwo,
Nya'adonji kanyo, pinyruodhi mar hera.

verse1:
Tim kinda mar lemo, kiwuoyo kod Ruoth;
Pidh chunyi gi wachne, kibedo kuome;
Lalri gi jokristo, kony jogo manyap;
To wiyi kik wil ngan'mar dwaro gwethne.

verse2:
Tim kinda mar lemo, piny kadho piyo;
Ket kinde mar bedo apanda kod Ruoth;
Tin'wan' kuom Yesu, ilu e ndache,
Mi timni nonyis ji kichalo kode.

verse3:
Tim kinda mar lemo, Ruoth oteloni;
Kik iring e nyime, to kik idon'chien;
E mor kata chandruok, lu Yesu pile;
Chom wan' kuom Yesu, kigeno wachne.

verse4:
Tim kinda mar lemo, chunyi okuwe mos;
Yie Yesu chik chunyi kuom paro maler;
To Roho notelni kuom hera mare,
Noiki ni tichne e polo malo.

verse1:
Winj weche ma Yesu nowacho,
Weche madier, mag ngima winjiuru ji duto, mondo upargi;
"Gin johawi momako chikna."

verse2:
Winjo nono onge gi konyruok;
Mit singruokne bedo kayiem; winjogi, luorogi, ok onyal konywa;
Gin johawi momako chikne.

verse1:
Ka Yesu ni koda, ee, anyalo dhi
Kata ka manade piny ma mwalo ni;
To ka Yesu onge morna orumo;
Ka Yesu ni koda ok anyalo luor.

verse2:
Ka Yesu ni koda ok naluor chandruok; 
Kata tem man'ny olworo wan'ora;
En owuon noteme mondo okonya;
Ka Yesu ni koda anyalo loyo.

verse4:
Ka Yesu ni koda anawinj luongne;
Ka'ochika mon'adhi e pinje mwa,
Mon'apuonj jopiny warruok man kuom rembe;
Ku mochiko anadhi ka wan kode.

verse5:
Ka Yesu ni koda anyalo nindo;
Mak aluor mudho mar tho molwora ka;
Kan'yo ni anachiew e giko piny,
Ka manade kod Yesu ni ka maber.

verse1:
Yesu En Osiep maber chutho, ka parruok mar piny hewo chunyi;
Enochangi chuny motuo, nochiw teko gi n'ono,
Ee, Yesu En Osiep maber ngan'

verse2:
Yesu En Osiepna moloyo; Omiya kuwe gi mor e chunya;
An kapadora kuome, ok aluor gimoro ngan'
Ee, Yesu En Osiep maber ngan'

verse1:
Yesu ni Jakwadhwa, to wan rombege;
En kowuotho kodwa wanaluor an'?
Mondo walu ban' ka motelonwa;
Oritowa pile, to oherwa.

verse2:
Yesu ni Jakwadha, wan'yo dwonde;
En kowuoyo kodwa koro chunywa mor;
Kata ka waketho, nowe kethruokwa;
En kende Jakonywa, to wan nyithinde.

verse3:
Yesu ni Jakwadhwa, rembe nochwernwa;
Mon'oluokwa chutho e kethruok duto;
Oketo ranyisi kuom nyithinde te;
Mago joge duto man gi Much Nyasaye.

verse4:
Yesu ni Jakwadha, bende Jagen'a;
E temruokwa duto wanalo Satan;
Ka wagene pile nyaka chien'watho,
Chien'ka Yesu  duogo eka wanachier.

verse1:
Ruoth Yesu, saa mar lamoi, Masuda machiegni kodi,
Mamiya paro duon'mar Ruoth, Kahulo dwarona duto;
Kar chandruok, kasudo iri, Chunya gi ringra yudo kuwe;
Kaloyo tem mar Satani; Ruoth, jiwa kuom saa mar lami.

verse2:
Ruoth Yesu, saa mar lamoi, Pile ayudo mor gi kuwe;
Jogo bende ma chunygi n'w Yudo teko kuom lamoi;
Pile kachandora malit, Aringo ir Ruoth Jawarna;
Kuome ayudo mor maduon' Kojiwa kuom saa mar lemo.

verse3:
Ruoth Yesu, saa mar lamoi, Saano mar neni gi chunya,
Ka chunya pon'gadierani Inigwedha kuom kwayona;
Adwaro neni wan'gi wan' Kayie wachni gi n'ononi;
Yesu Ruodha, rita pile, Kijiwa kuom lami pile.

verse1:
Saa mar lemo mogwedhi, ka chunywa kulore,
E nyim Yesu Jawarwa bende Osiepwa;
Kwachopo ire kuom yie, ka wageno ritne;
Wanayud yueyo kanyo, wanayud kuwe mar chuny.

verse2:
Saa mar lemo mogwedhi, ma Jawar sudonwa;
Chunye n'on bende oyie winjo nyithinde;
Parruok machando chunywa, waweuru kuome;
Wanayud yueyo kanyo, wanayud kuwe mar chuny.

verse3:
Saa mar lemo mogwedhi, kwasudo nyim Jawar;
Jo ma temruok oloyo noyud kuwe mar chuny;
En gi chuny makecho ngan'wanyise masichwa;
Wanayud yueyo kanyo, wanayud kuwe mar chuny.

verse4:
Kar saa nogo mar lemo, wagene kendo yie
Kaka gweth ma wakwayo wayudo adier;
Kwageno Ruodhwa adier, wanawe parruok te;
Wanayud yueyo kanyo, wanayud kuwe mar chuny.

verse1:
Weruru weche mag Nyasaye,weche mamit mag ngima;
Som giuru pile pile, weche mamit maber.
To gipuonjowa niya,ni mondo wagen Yesu.

verse3:
To kik wamun'ni ji me piny, weche mamit mag ngima;
To gin weche makonyogi, weche mamit maber.
Yesu Ruoth ma Jawarji, nopwodh chunygi gi wachne.

verse1:
Bedi mangima kuoma, Ruoth Yesu Jawarna;
Ka wach ochando chunya, inyisa wach maber;
Bedi mangima kuoma, chika e wan'ori;
An mon'abed ka taya manyiso ler mari.

verse2:
Asechiwoni chunya, gi ngimana duto,
Isepuodha kuom kethna, mondo arieny ni ji;
Ringra obed kar dakni, hekalu  maler;
Timna gi wuodha duto, obed gi michiko.

verse3:
Fuondega duto magi, In mon'iti kodgi;
Abed gir tichni chutho; kik atim dwarona;
Ruoth Yesu taya pile, kinyisa herani;
Weche piny ok nyal chanda ka In idak koda.

verse4:
Kuwe mari opon'chunya, abed mos kageni;
Arito mon'inyisa gi monego atim;
Bedi mangima kuoma, Ibed Ruoth e chunya;
To chien'mibiro, Ruodha, naneni wan'gi wan'

verse1:
Aseweyo tich maricho, Ni mondo alu Yesu;
En ma yandi ji nochaye, Osedoko ngimana.
Ok ageno teko moro, Ok ageno pith mar piny;
Pith adieri ni e chunya; Ruoth mar polo ni Ruodha.

verse2:
Mondo an' in koda, Pinyni oywayoa;
Aneno gik magombo, Dwonde matemoa;
Wasika gi gilwora, Kendo gin e chunya;
O Yesu, bi, ikonya, Mondo alo Satan.

verse1:
Ruoth ni koda e yo duto, Ere gi marem koro?
En Jatenda e piny kae, Nyaka ngimana duto;
Kuwe gi hoch ayudo kuome; Awuotho kode pile;
Kata gi manade yuda, Yesu norita maber,
Kata gi manade yuda, Yesu norita maber.

verse2:
Ruoth ni koda e yo duto, Kata yo obet marach;
Nokonya e temruok duto; Nomiya chiemb chuny maler,
Ka di po tienda dichwanyre, Enojuka gi luete;
Ka riyo oloyo chunya, Nomia pi mar ngima;
Ka riyo ohewo chunya, Nomia pi mar ngima.

verse3:
Ruoth ni koda e yo duto; An awuoro herane,
Mosesingona kar yueyo, Dala mar Nyasaye Wuora;
Anayud ngima mochwere, ka wuodha me piny rumo;
"Ruoth notelna e yo duto," Nobed wenda nyaka chieng`
"Ruoth notelna e yo duto," Nobed wenda nyaka chieng.

verse1:
Telna O yaye Ruoth Jehova, Kuom wuodha e piny marach;
An anyap to in gi teko Juka gi lueti matek
Kuon mar polo Kuon mar polo, Pidha nyaka yien'chutho (yien'chutho).

verse2:
Yaw koro soko mar lerni Kama pi ngima wuokie;
Ket bor Polo maber mogwedhi Telna e wuodha duto;
Ruoth molocho Ruoth molocho, Bed teko 'kumba (gokumba).

verse3:
Ka wuotho e geng aoch Jordan Mi mondo luocha olal;
Ruodh ruodhi makelo ngima Kel ngima loka Kanaan;
Wende ma paki Wende ma paki, Ana wer nigi pile (wer pile).

verse2:
Yesu kotaya pile, Ok anaparora;
Piny ok onyalo teroa, Kata richo kethoa;
Kata aparo ndalo Ok analuor gimoro;
Kata ane masira, Chien'anamor kucha.

verse3:
An anadhi ka Yesu, En ma notho kuoma;
Pile ageno Yesu, Lwandana mogen'na;
Piny pod otimo mudho Ka pod awuotho kae;
Piny to norum mapiyo, Eka nadhi kucha.

verse2:
Napenjo kendo jakedo; Nomiya wach mahoyo chuny;
`Kedi matek, ibed jachir, Ndalo odon'matin.`
Kik koro ibed gi kuyo, Tim kinda nyaka tich rumo;
Wabiro yudo pok maber Kwaseyudo locho.

verse4:
Timbe mag piny nyiso ji duto wach;
Yesu obiro kendo!
Yembe- gapaka medo lando wach;
Yesu obiro kendo!

verse5:
Mirimb jopiny miyowa yango wach;
Yesu obiro kendo!
Kwonde piny duto rieko medore;
Yesu obiro kendo!

verse1:
Singruok maber ngan'ni jogo moyie,
"Abiro mapiyo mar omo joga;
Rituru maber nyaka abiro;
Ayulwan'kik teru; timuru kinda."

verse2:
Wamok techewa, waritre galam;
Nobi ka jakuo ni jo ma ok rite;
Ranyisi yango kaka ochiegni,
To wakiya ndalo; ber watim kinda.

verse3:
Mano genowa mondikie Wachne;
Kaka Ruodhwa Yesu nobi gi duon'e;
Wachni oriwo singruokne duto;
"Neuru, abiro; timuru kinda."

verse2:
Mor ni jopiny Ruoth enolo! Ji mondo gidende;
Pinje, nembe, gode, pewe, Dwoko gi dwol mamor, Dwoko gi dwol mamor,
Dwoko gi dwol mamor chutho. (Dwoko gi dwol mamor).

verse1:
Ne! obiro e koth polo, En ma yan'otho ni ji;
Malaika duto kowe Ka gibiro choko ji.
Alleluya! Chien'Nyasaye to chiegini.

verse3:
N' ma tinde kwero Yesu chien'o En nokwere be;
Enone malit moloyo ka warruok okadhone.
Enoyuagi, Enone mirimb Nyasaye.

verse1:
Yesu nobi kendo mondo oom joge;
Eka joge maler duto nobed kama Entie.
Un kik ukul wiu, to n'uru malo;
Nobi gi duon'modhiero ngan'
Yesu Ruoth warruokwa.

verse3:
Wan' maliel ka mach notiek jo maricho;
Onge lep ma nowach nyinge kayiem e ndalono;
Onge n' ma nonyier Jokristo e chien'o;
Alam gi yuak mag jodong piny nobed kayiem chien'o.

Kwatiyo gi hera to en tich mamit;
Konyruok anwa malo, konyruok mosiko;
Ruodh hera moluongwa, wadhi wamak tich;
Cham ritowa koro to keyono duon'

verse2:
Chien'o ma jo maler duto nowinji dwond bu kayuak.
Giniwuogi ka gia e lietegi;
Eka ginichokre kanyakla e dalano maler;
Ka iluongo nying jo maler, nabedie!

verse3:
Watiuru ni Yesu gi kinda nyaka oduogi;
Walanduru herane kwonde duto;
Eka chien'o ma tichne duto norum e pinyni,
Ka iluongo nying jo maler, nabedie!

verse1:
Ruodha, ok agomb moko, kata mwandu mar piny;
To adwaro ni mondo achopi e polo;
E kitapi mar Ngima, Yesu mon'inyisa,
Kata nyinga ondiki e kitapi kanyo.

verse2:
An gi richo man'ny ngan' machalo gi kuoyo;
Kata kamano, Ruodha, Rembi e moromo;
Nikech isesingo ni kata gibed makwar,
Ginibedi matar ngan' moloyo pe matar.

verse3:
Yaye, dalano maber ngan' man gi udi marieny,
Kanyono jo modakie nigi nengni matar;
Jomalaika nitie e dala malerno;
Nyinga bende ondiki, e kitapi koso?

verse2:
Weche mag Nyasaye koro dhiyo piny duto,
Lando wach ni ji kuom Jawarwa Ruoth Yesu;
Chunywa koro mor, ka waneno ranyisi;
To ok wan'yo saa.

verse3:
Wakiye koro, teche duto wamoko;
Wanati matek nyaka Ruodhwa oduogi;
Wan'yo adier, koro ndalo mag giko,
To ok wan'yo saa.

verse1:
Nitie piny moro maber chutho; Koroni pod wanene gi chien;
Nyasachwa oritowa kanyo, Olosonwa kar dak e polo.

Wanamor nyaka chien' Wanamor kwatundo e polo;
Wanamor nyaka chien' Wanamor kwatundo e polo.

Wa winjo mar dala Nyasaye, E piny maber kendo manyien;
Wawuoro kaka enobed, To wagombo bedo kanyo!
Nitie wan'o mar dhahabu, Kod udi madongo kucha;
Kar bet ma Yesu oloso Ni jogo duto magene.

verse3:
Ruoth Yesu, los chunywa maler, Ni mondo wadonj e polo;
Wadwaro neno dalano, Koa e polo kuom Nyasaye,
Moikore ka miaha, Kolosore chuth ni Ruodhe;
Wanamodhi pi mar ngima, Ma Ruoth ose loso kanyo.

verse1:
Pinyni ok thurwa mwageno;
Waonge dala mosiko;
To wachni ohoyo chunywa,
Wakiyo dala mabiro,
Wakiyo dala mabiro.

verse2:
Pinyni ok thurwa mwageno;
Wakiyo dala ma ok nen;
Zayun e nyinge dala Ruoth;
Orieny gi ler ma nyaka chien'
Orieny gi ler ma nyaka chien'

verse3:
Dala maber mar mor gi kuwe;
Kar hawi chandruok onge chuth;
Da an gi buomb winyo koro,
Daringi mon'ayue kanyo,
Daringi mon'ayue kanyo.

verse1:
Nitie ber kwonde duto, Ka kuwe nie dala;
Nitie mor kuom dwonde te, Ka nitie hera.
Kuwe kod mor ogundhonwa,
Kwonde duto mor nitie;
Saa bende kadho gi mor, Ka nitie hera.

verse2:
Ji duto bedo mamor, Ka kuwe nie dala;
Sin gi nyiego onge chuth, Ka nitie hera.
Chuny joot te yudo kuwe,
Piny obet maber kodgi;
Mor nitie e ngimagi, Ka nitie hera.

verse3:
Polo yudo mor maduon'Ka kuwe nie dala;
Piny duto opon'gi mor, Ka nitie hera;
Wer mamit ma ji wero,
Ler marieny moa malo,
Nyasachwa mor e polo, Ka wan kod hera.

verse4:
Kabedo n'ti chutho, Nanyis herani;
Ka angima kuomi, Ruoth, Eka mor nitie;
Anayue kuom kethruok te,
Mak apar masich richo;
Kuom n'ononi nigwedha, Ka nitie hera.

verse1:
Wamor kwaromo kod osiepe;
E piny ma mwalo ni;
To chunywa kuyo ka waparo;
Wabiro pogore.

verse2:
E pinyni tho opogowa kod;
Osiepe mwahero;
Wamor kwageno wananegi,
E piny maber manyien.

verse3:
Kucha ok wanawachi chutho;
Wach moro mar pogruok;
To mor gi kuwe nobed e chunywa,
Pile ma nyaka chieng.

verse1:
Ruodha, dak ipogna kuon mar ngima,
Kaka nipogo kuon ni jo machon;
Asomo Wachni, Ruoth, kadwaroi;
Chunya ogomboi, Wach Mangima.

verse2:
Gwedh Wachni, koro Ruoth, masewinjo;
Kaka nigwedho kuon ni jo machon;
Pidha gi Wach mari, ayud teko;
Eka nayud kuomi konyruok duto.

verse3:
Wecheni gin ngima, Miwachona;
Adwaro timogi to an ayom,
In kende, konyruokna;
In ngimana kawinjo wachni, Ruoth nalo lwenj chuny.

verse1:
Yesu Ruoth, nisethona, Gen' kik atim richo;
Rembi ma nochwer e yath, Pi ma nowuok e n'ti,
Mon'oluok richo kuoma, Opwodha abed maler.

verse2:
Tich mar lueta ok dinyal chopo chik ka'idwaro;
Kindana kod tekona, Kata ka pi wan' chwer,
Ok nyal gola e richo, Mak mana In kendi, Ruoth.

verse3:
Aonge gi ma dagen, To mana msalapi, Ruoth;
Abiro mon'iruaka, An ageno n'ononi;
Jawarna, abironi, Luoka mondo kik atho.

verse1:
An to amor ngan'
Wuonwa me polo;
Ohero nyithinde duto e piny;
Onge moro maromo herane,
Hera Nyasaye e moloyo duto.

Wan nyithind Ruodhwa Yesu, Ruoth Yesu e polo;
Wan nyithind Ruodhwa Yesu, To wawer wawuotho.
Ka Yesu otelonwa, to ok wanaluor gimoro;
Ka waluwo ban'Yesu, wanawer kwawuotho.

verse3:
Mor Nyasaye pon' chunywa Ka wadhi e polo;
Mor Nyasaye, pon' chunywa, Ee, wamor moloyo.
Nyaka wuodhewa norum Nyasaye nobedi Jakonywa;
Nyaka wadonjie polo wanawer kwawuotho.

verse1:
Ruodha, dak imiya tich, An ahero tiyoni;
Ka'aonge teko ngan' to agombo tichni, Ruoth;
Kata luetena tindo, tich matindo anyalo.

verse2:
Puonja, Ruoth, ka pod atin, weche kitapi maler;
Konya mon'aluwi chuth, kendo an' dwaroni;
Kaw chunya gi luetena, We atini, Ruoth man'on.

verse3:
Konya ndalo duto te, mon'atim gik mabeyo;
Rit lewa gi luetena, chunya mon'ogeni chuth;
Taya pile kawuotho, kik abar e wan'ori.

verse1:
Yesu'era, an'yo, to Biblos owachona;
An nyathine, En man'on,
Kendo En ogwedho an.

verse5:
Paruru, nyithindo, weche mag Nyasaye;
Chien'unyalo donjo kama entieno.



            ...

verse3:
Chungo e singono anyalo neno,
Puodhruok mogik kare manotim ni an;
Chungo ka an thuolo nikech Ruoth;
Kachungo e singo mar Nyasaye.

verse2:
Ne an mabor ne ok ageno kuomi, Koro telna;
Ne ahero yiero yora awuon, koro telna;
Chunya kod ringruok ne kedo lweny mager,
Sunga machon ok anapar kendo.

verse3:
Teko mari mosegwedha adier,
Pod notelna kuom chandruok gi masiche moluora ndalo duto;
Ban' namor kod jomalaika masegombo neno ndalo duto.

verse1:
Anatimu joyuwa ji,
Joyuwa ji, joyuwa ji;
Anatimu joyuwa ji,
Ka ulu bang'a;

E chunya, e chunya,
Donji e chunya, Ruoth Yesu;
Donji koro, ibed koda;
Donji e chunya, Ruoth Yesu.
